import '../leftBar/leftBar.css';
import Vk from '../leftBar/VK.svg'
import React from "react";
export default function leftBar (){
    return(
        <div className = 'leftBlocks'>
            <div className = 'link'>
                <div className = 'imgLinks'>
                    <img id = 'vk' src = {Vk} ></img>
                </div>
            </div>
        </div>
        
    );
};
